Create a cargo project that demonstrates the regression. Let's use issue #53157 as an example: cargo new foo
cd foo Edit src/main.rs with the example from the issue: macro_rules! m { () => {{ fn f(_: impl Sized) {} f }}
} fn main() { fn f() -> impl Sized {}; m!()(f());
} Since we are testing an old regression, also edit Cargo.toml to remove the edition = "2021" field which isn't supported in these versions. Then run cargo bisect-rustc --end=2018-08-04. We need to provide the end point for this particular example because that's an old regression already fixed on the latest nightlies. We could also provide a start point if we know one; that's going to make it faster by avoiding scanning for the start. For instance: cargo bisect-rustc --start=2018-05-07 --end=2018-08-04 It will run cargo build in the project and check whether or not it fails. It will do a binary search between the start and end range to find exactly where the regression occurred. Note : You can also use the flag --regress to specify other common regression criteria, e.g. --regress=ice for internal compiler errors. In our example, in just a few steps, we can we find that it stopped working on nightly-2018-07-30. If the regression is recent enough, then it will print out a list of PRs that were committed on that date. In this particular example, it is too old, so we'll need to manually inspect the git log to see which PR's were merged. If the nightly was within the last 167 days, then cargo-bisect-rustc will then start bisecting those individual PRs. After finding potential candidates, you can go inspect those PRs to see which one is the likely cause. In this case, since the ICE was in MIR const propagation, and #51361 is the likely candidate since it modified const evaluation.

