Pass/fail of cargo build may not be what you're after. Perhaps the issue is an error message changed, so both the "good" and "bad" version will fail to compile, just with a different message. Or maybe something used to fail, and now erroneously passes. You can use the interactive feature with the --prompt flag to visually inspect a build and tell cargo-bisect-rustc what's "good" and what's "bad". Let's use issue #55036 as an example where an error message changed: In Cargo.toml, remove the edition field (this example was before editions). src/main.rs: struct Foo { bar: i32
} trait Baz { fn f(Foo { bar }: Foo) {}
} fn main() {} This historically emitted a bad error, was updated to emit a nice error (E0642 added in #53051), but then that nice error was lost somewhere (on the 2015 edition). Let's find where it was lost! Grab the ranges between where it was added and where we know it fails: cargo bisect-rustc --prompt \ --start=2018-08-14 \ --end=2018-10-11 At each step, cargo-bisect-rustc will show the output and ask you: nightly-2018-08-14 finished with exit code Some(101).
please select an action to take:
> mark regressed mark baseline retry Choose mark baseline with the nice E0642 message, and mark regressed with the less-favorable token error. Fairly quickly we find it regressed in nightly-2018-10-11. The most likely candidate is #54457 which is a rollup PR. It's usually not too hard to look through the commits and find a likely culprit. Indeed in this example, #54415 modified function parameter parsing.

